<script>
    import G2Line from '../common/linechart1.vue'
    import G2 from '@antv/g2'
    export default {
        name: 'dashboard',
        components: {
            G2Line
        },
        data() {
            return {
                linechartData:[],
                listdata:'',
                bardata:'',
                
            }
        },
        created() {
           this.getlinedata()
           this.getlistdata()
        },
        mouted(){
          var _this = this
          setTimeout(function(){
            _this.load()
          },500)
       
        },
        computed: {

        },
        methods: {
            getlinedata(){
                this.$get('index/channel-analysis').then((res) => {
                    console.log(res)
                    var array = res.info;
                    function flat() {
                        var flatArr = []
                        return function flatten(arr) {
                            for (let index = 0; index < arr.length; index++) {
                            Array.isArray(arr[index])
                                ? flatten(arr[index])
                                : flatArr.push(arr[index])
                            }
                            return flatArr
                        }
                    }
                    this.linechartData = flat()(array)
                    console.log(this.linechartData)
                    // if(res.code===1){
                    //     this.tableData = res.info.items;
                    // }else{
                    //     this.$message.error('数据加载失败');
                    // }
                    this.loading = false
                }).catch( () => {
                    this.loading = false
                })
            }, 
            getlistdata(){
                this.$get('index/index').then((res) => {
                    if(res.code===1){
                        this.listdata = res.info;
                    }else{
                        this.$message.error('数据加载失败');
                    }
                    this.loading = false
                }).catch( () => {
                    this.loading = false
                })
            }, 
            load() {
              var data = [{
                  name: 'MODIFY',
                  value: 138,
                  washaway: 0.21014492753623193
                }, {
                  name: 'PRERELEASE',
                  value: 109,
                  washaway: 0.5596330275229358
                }, {
                  name: 'RELEASING',
                  value: 48,
                  washaway: 0
                }];
                var colorSet = {
                  MODIFY: '#4FAAEB',
                  PRERELEASE: '#9AD681',
                  RELEASING: '#FED46B'
              };
              var Shape = G2.Shape;
              Shape.registerShape('interval', 'textInterval', {
                draw: function draw(cfg, group) {
                  var points = this.parsePoints(cfg.points); // 将0-1空间的坐标转换为画布坐标
                  var value = cfg.origin._origin.value;
                  group.addShape('text', {
                    attrs: {
                      text: value,
                      textAlign: 'center',
                      x: points[1].x + cfg.size / 2,
                      y: points[1].y,
                      fontFamily: 'PingFang SC',
                      fontSize: 12,
                      fill: '#BBB'
                    }
                  });
                  var polygon = group.addShape('polygon', {
                    attrs: {
                      points: points.map(function(point) {
                        return [point.x, point.y];
                      }),
                      fill: cfg.color
                    }
                  });
                  return polygon;
                }
              });
              Shape.registerShape('interval', 'fallFlag', {
              getPoints: function getPoints(_ref) {
                var x = _ref.x,
                  y = _ref.y,
                  y0 = _ref.y0,
                  size = _ref.size;

                return [{
                  x: x + size,
                  y: y0 + size
                }, {
                  x: x,
                  y: y
                }];
              },
              draw: function draw(cfg, group) {
                if (cfg.origin._origin === data[data.length - 1]) {
                  return;
                }
                var points = this.parsePoints(cfg.points); // 将0-1空间的坐标转换为画布坐标
                var p1 = points[0];
                var width = 9;
                var washaway = cfg.origin._origin.washaway;
                group.addShape('text', {
                  attrs: {
                    text: (washaway * 100).toFixed(1) + ' %',
                    x: p1.x - width / 2 - 14,
                    y: p1.y - 14,
                    fontFamily: 'PingFang SC',
                    fontSize: 12,
                    fill: '#BBB'
                  }
                });
                var polygon = group.addShape('image', {
                  attrs: {
                    x: p1.x - 16,
                    y: p1.y - 16,
                    img: 'https://zos.alipayobjects.com/rmsportal/JuBdciUyUAkewNAetxtS.png',
                    width: 32,
                    height: 32
                  }
                });
                return polygon; // 将自定义Shape返回
              }
            });
              var chart = new G2.Chart({
                container: 'mountNode',
                forceFit: true,
                height: window.innerHeight
              });
              chart.legend(false);
              chart.source(data, {
                value: {
                  alias: '访问数'
                },
                name: {
                  alias: '步骤名称'
                }
              });
              chart.axis('name', {
                title: null
              });
              chart.interval().position('name*value').shape('textInterval').color('name', function(value) {
                return colorSet[value];
              }).size(30);
              chart.interval().position('name*value').color('#E4E4E4').shape('fallFlag');
              chart.render();
            }
        }
    }
</script>


